text:
hook up is the story of three friends, cindy, mindy, and tyler, who are beginning their first year at lanark university. it‚Äôs their first experience being away from home and they welcome their newfound freedom. this freedom comes with its own complications. as they begin to discover who they are as individuals and their hopes for the future, they are forced to face changes in the dynamics of their relationships with each other.  we also watch as they struggle with the aftermath of sexual assault and ideas regarding consent.

this story is so important, and engages in topics, such as rape culture on campus, binge drinking, slut shaming, sexual assault, and consent, that need to be talked about more openly. 
for tickets and more information: https://www.passemuraille.ca/wp/18-19-season/hook-up/

@tapestryopera @beyondwallstpm 
